// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract BetPulse is Ownable, ReentrancyGuard {
    IERC20 public pulseToken; // Endereço do contrato PulseToken
    struct Bet {
        uint256 amount; // Quantidade de PULSE apostada
        uint256 odds; // Odds do evento
        bool resolved; // Se a aposta foi resolvida
        bool won; // Se o usuário ganhou
    }
    mapping(address => mapping(uint256 => Bet)) public bets; // Mapeia usuário -> ID do evento -> aposta
    mapping(uint256 => bool) public eventOutcomes; // Resultados dos eventos
    mapping(uint256 => mapping(address => bool)) public hasWithdrawn; // Rastreia saques por usuário e evento
    uint256 public eventIdCounter;

    constructor(address _pulseToken, address initialOwner) Ownable(initialOwner) {
        pulseToken = IERC20(_pulseToken);
    }

    // Função para colocar aposta
    function placeBet(uint256 eventId, uint256 amount, uint256 odds) external nonReentrant {
        require(!eventOutcomes[eventId], "Evento ja resolvido");
        require(amount > 0 && odds > 0, "Valores invalidos");
        require(pulseToken.transferFrom(msg.sender, address(this), amount), "Falha na transferencia");
        bets[msg.sender][eventId] = Bet(amount, odds, false, false);
    }

    // Função para resolver evento (apenas dono)
    function resolveEvent(uint256 eventId, bool outcome) external onlyOwner {
        require(!eventOutcomes[eventId], "Evento ja resolvido");
        eventOutcomes[eventId] = true;
        // Atualiza o status de resolução e resultado das apostas associadas
        for (uint256 i = 0; i <= eventIdCounter; i++) {
            if (bets[msg.sender][i].amount > 0 && !bets[msg.sender][i].resolved) {
                bets[msg.sender][i].resolved = true;
                bets[msg.sender][i].won = (i == eventId && outcome);
            }
        }
    }

    // Função para sacar ganhos
    function withdrawWinnings(uint256 eventId) external nonReentrant {
        Bet storage bet = bets[msg.sender][eventId];
        require(eventOutcomes[eventId], "Evento nao resolvido"); // Verifica resolução oficial
        require(bet.resolved, "Aposta nao resolvida");
        require(bet.won, "Aposta nao vencedora");
        require(!hasWithdrawn[eventId][msg.sender], "Ganhos ja sacados");
        uint256 payout = bet.amount * bet.odds / 100;
        require(payout <= bet.amount * 1000, "Payout excessivo"); // Limite de 1000x para segurança
        require(pulseToken.transfer(msg.sender, payout), "Falha na transferencia");
        hasWithdrawn[eventId][msg.sender] = true;
        delete bets[msg.sender][eventId];
    }
}

